Analyze the following email to decide whether to send it to 'jerry', 'tom', or 'ben':

1) If it's primarily about developer or technical questions, bug reports, or feature implementation (e.g., APIs, SDK, crashes, advanced configuration), route to 'jerry'.
2) If it's about marketing, competitor references, social media, user events, domain/newsletter tasks, or training resources, route to 'tom'.
3) If it involves complaints, billing, data privacy, press or media, investor inquiries, legal concerns, or general partnership, route to 'ben'.
4) If multiple topics apply, choose 'ben' if it includes any complaint, billing, press, investor, or legal elements. Otherwise prefer 'jerry' if it has strong technical aspects. Otherwise route to 'tom'.

